them to others unless they have membership access. They will have to sign on as a member in order to view them. \nProcess\nView the instructional video here.\nUpload the Files to the Correct Wild Apricot Directory\nSave the Secretary and Treasurer file attachments to your downloads folder. \nSign in with the President login to Wild Apricot\nClick on the Admin tab\nClick on the Website tab\nNavigate to the Files tab located at the top of the screen - Note that the default folder will be the last one the President signed into. \nNavigate to the appropriate folder as follows:\nTo upload Agenda and Minutes - navigate to Documents\u003eBoard Agendas and Minutes\nTo upload financials, navigate to Documents\u003eFinancials\nOnce in the appropriate folder, click on the upload button:*\nClick browse and navigate to the downloads folder where the documents to be uploaded are stored:*\nClick on the files to be uploaded and press Enter. The upload will begin. When it is finished, verify the document(s) were uploaded.\nInsert the Files in the Board Packet Email\nNavigate to the Main Menu by clicking the home icon and select the Email Module, then select Emails.\nPress Compose Email\nFind and Select Board Packet in the templates area\nClick into the box where you want to edit and enter your message. Click Save when finished.\nClick preview to view email.\nClick Recipients and select ZZZ-BoardDirectorySearch and ZZZ - ChairDirectorySearch:*\nChange the Subject: line and include the month/year the meeting will be held.\nClick Review and Send. Either send it immediately or schedule a day/time to send it. Either click Send or if it is still a work in process, click Save \u0026 Exit to return to it later.\n"},{"ty":"is","ibi":1955,"s":"\u0003\n\nUploading Board Packet Documents\n\u0003\n\u0003\n\u0003\n\n\u0003\n\u0003Page \nRev. 2022-02-03\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_mt":103.5,"ds_fi":"kix.hf4","ds_ulhfl":false,"ds_hi":"kix.hf1","ds_epfi":"kix.hf3","ds_ephi
